import { useParams } from 'react-router-dom';

function GalleryView({ galleries }) {
    let { galleryId } = useParams();
    let gallery = galleries.find((gallery) => gallery.id = galleryId);
    console.log('galleryId', galleryId, 'gallery.id', gallery.id);

    return (
        <h1>{gallery.name}</h1>
    );
}

export default GalleryView;
